import React from 'react';
import ReactDOM from 'react-dom';
import Quiz from './quiz';


ReactDOM.render(
  <div>
    <h1>Test Quiz</h1>
    <div id="prompt">Choose the correct answer out of the four given answers.</div>
    <br></br>
    <Quiz />
  </div>, document.getElementById('root')

);
